var title_f38_34_39458="Cardiac remodeling after anterior MI";
var content_f38_34_39458=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F69944&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F69944&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 488px\">",
"   <div class=\"ttl\">",
"    Cardiac remodeling after anterior myocardial infarction",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 468px; height: 429px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Late ventricular enlargement, or remodeling, resulting from increased circumference and sphericity, produces a marked increase in volume. The late change in circumference is due to lengthening of contractile tissue rather than further expansion of the infarcted, noncontractile segment. The increased sphericity results from a rounding out of the sharp abnormalities in contour at the margins of the infarct.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from the American College of Cardiology, J Am Coll Cardiol 1992; 19:1136.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.elsevier.com/locate/jacc\">",
"      file://www.elsevier.com/locate/jacc",
"     </a>",
"     <br/>",
"     <a href=\" file://www.sciencedirect.com\">",
"      file://www.sciencedirect.com",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
