" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 546px\">",
"   <div class=\"ttl\">",
"    Common locations of nasal foreign bodies",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 526px; height: 404px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Nasal foreign bodies are typically located on the floor of the nasal passage near the inferior turbinate or superiorly in the nasal cavity just anterior to the middle turbinate.",
"    <br>",
