" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 520px\">",
"   <div class=\"ttl\">",
"    Acute lobular hepatitis (low power, Masson trichrome)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 500px; height: 378px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Note that the homogeneous appearance of the normal liver is replaced by a dense infiltration of mononuclear inflammatory cells in sinusoids and scattered areas of lighter staining of hepatocytes caused by liver cell necrosis. Also note that there are no areas of confluent liver cell necrosis and that a central vein, stained blue, is now more prominent.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Marshall M. Kaplan, MD.",
"    </div>",
"   </div>",
"  </div>",
