var title_f38_34_39467="Causes of hypertriglyceridemia";
var content_f38_34_39467=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F75442&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F75442&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Primary disorders of triglyceride metabolism",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Disorder",
"       </td>",
"       <td class=\"subtitle1\">",
"        Lipid levels",
"       </td>",
"       <td class=\"subtitle1\">",
"        Confirmatory studies",
"       </td>",
"       <td class=\"subtitle1\">",
"        Physical findings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Type I hyperlipoproteinemia",
"       </td>",
"       <td>",
"        TG &gt;99th percentile",
"       </td>",
"       <td>",
"        Overnight refrigerated plasma sample with creamy",
"supernatant and clear infranatant; chylomicrons verified by",
"ultracentrifugation; LPL activity &lt;10 percent normal; apo C-II",
"deficiency; absence of secondary causes",
"       </td>",
"       <td>",
"        Eruptive xanthomata (50 percent); hepatosplenomegaly;",
"lipemia retinalis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mixed hypertriglyceridemia (type V)",
"       </td>",
"       <td>",
"        TG &gt;99th percentile",
"       </td>",
"       <td>",
"        Overnight refrigerated plasma sample with creamy",
"supernatant and cloudy infranatant; LPL activity reduced; apo C-II",
"deficiency; apo C-III inhibitor may be present infranatant;",
"       </td>",
"       <td>",
"        Eruptive xanthomata",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Familial dysbetalipoproteinemia (type III)",
"       </td>",
"       <td>",
"        TC &gt;90th percentile; TG &gt;90th percentile",
"       </td>",
"       <td>",
"        VLDL-chol/total TG &ge;0.3; Chylomicron and VLDL",
"remnants; apo E2/2 phenotype; apo E variant isoform",
"       </td>",
"       <td>",
"        Xanthomata palmare striatum; tuberoeruptive xanthomata",
"(in patients without obstructive liver disease)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Summary of diagnostic criteria for the different forms of hypertriglyceridemia.",
"    <div class=\"footnotes\">",
"     TC: total cholesterol; TG: total triglycerides; LPL: lipoprotein lipase.",
"     <br>",
"      Summary of diagnostic crieria for the different forms of hypertriglyceridema.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Data from Rosenson, RS, Frauenheim, WA, Tangney, CC, Dis Mon 1994; 40:369.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
