var title_f38_34_39468="Surgical risk groups";
var content_f38_34_39468=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F58607&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F58607&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Categories of risk for venous thromboembolism in surgical patients (From the 2004 ACCP Guidelines)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Low risk:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Minor surgery in patients &lt;40 years of age with no additional risk factors present*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Risk of calf DVT: 2 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Risk of proximal DVT: 0.4 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Risk of clinical PE: 0.2 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Risk of fatal PE: &lt;0.01 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Moderate risk:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Minor surgery in patients with additional risk factor present*,",
"        <strong>",
"         or",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Surgery in patients aged 40 to 60 with no additional risk factor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Risk of calf DVT: 10 to 20 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Risk of proximal DVT: 2 to 4 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Risk of clinical PE: 1 to 2 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Risk of fatal PE: 0.1 to 0.4 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        High risk:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Surgery in patients &gt;60,",
"        <strong>",
"         or",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Surgery in patients aged 40 to 60 with additional risk factor*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Risk of calf DVT: 20 to 40 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Risk of proximal DVT: 4 to 8 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Risk of clinical PE: 2 to 4 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Risk of fatal PE: 0.4 to 1.0 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Highest risk:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Surgery in patients &gt;40 with multiple risk factors*,",
"        <strong>",
"         or",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hip or knee arthroplasty, hip fracture surgery,",
"        <strong>",
"         or",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Major trauma, spinal cord injury",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Risk of calf DVT: 40-80 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Risk of proximal DVT: 10-20 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Risk of clinical PE: 4-10 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Risk of fatal PE: 0.2-5 percent",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     DVT: deep vein thrombosis; PE: pulmonary embolism.",
"     <br>",
"      * Additional risk factors include one or more of the following: advanced age, cancer, prior venous thromboembolism, obesity, heart failure, paralysis, or presence of a molecular hypercoagulable state (eg, protein C deficiency, factor V Leiden).",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Data from Geerts WH, et al. Chest 2004; 126:3385.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
